import './style.css';
import "../textsFormate/formate.css";
import background1 from "../img/exemplo1.jpg";
import background2 from "../img/exemplo2.jpg";
import background3 from "../img/exemplo3.jpg";
import background4 from "../img/exemplo3.jpg";
import background5 from "../img/exemplo3.jpg";
import { Link } from "react-router-dom";

export default function BlogCards() {
    return (
        <div className="d-flex flex-wrap justify-content-center">
            {blogData.map((blog) => (
                <div key={blog.id} className="m-3">
                    <div className="card" style={{ width: "18rem" }}>
                        <img
                            className="card-img-top"
                            src={blog.background}
                            alt={`${blog.name} - imagem`}
                            style={{ height: "200px", objectFit: "cover" }}
                        />
                        <div className="card-body">
                            <p className="card-text text-muted mb-2">
                                {blog.date}
                            </p>
                            <h5 className="card-title">{blog.name}</h5>
                            <p className="card-text">{blog.description}</p>
                            <Link to="/" className="btn btn-primary">
                                Saiba mais
                            </Link>
                        </div>
                    </div>
                </div>
            ))}
        </div>
    );
}

const blogData = [
    {
        id: 1,
        name: "Projeto 1",
        classification: "Dashboard",
        date: "01/01/2021",
        description: "Descrição do Projeto 1",
        background: background1,
    },
    {
        id: 2,
        name: "Projeto 2",
        classification: "Figma",
        date: "01/01/2021",
        description: "Descrição do Projeto 2",
        background: background2,
    },
    {
        id: 3,
        name: "Projeto 3",
        classification: "Web Design",
        date: "01/01/2021",
        description: "Descrição do Projeto 3",
        background: background3,
    },
    {
        id: 4,
        name: "Projeto 4",
        classification: "Web Design",
        date: "01/01/2021",
        description: "Descrição do Projeto 4",
        background: background4,
    },
    {
        id: 5,
        name: "Projeto 5",
        classification: "Web Design",
        date: "01/01/2021",
        description: "Descrição do Projeto 5",
        background: background5,
    },
];
